description:
Collector, The (2009)  

Verenigde Staten
Horror / Thriller
88 minuten

geregisseerd door Marcus Dunstan
met Andrea Roth, Madeline Zima en Robert Wisdom

Een ex-oplichter is wanhopig op zoek naar geld om zijn vrouw af te betalen, zodat ze de stad niet verlaat met hun dochter. Als hij inbreekt in het huis op het platteland van zijn rijke baas, komt hij erachter dat de familie wordt vastgehouden door een gemaskerde moordenaar, die het huis vol boobytraps heeft gezet.

Vertaald door Simply ReleaseS Toppers
Tokke, Scrivs en Suurtje

